script: |
  super -f text -I q13362.spq | sort > q13362.out

inputs:
  - name: q13362.spq
    data: |
      SELECT - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col1 BETWEEN + 35 / - + col2 + 15 * - col1 AND - 78;
  - name: tab0

outputs:
  - name: q13362.out
    data: |
      -10
      -47
      -99
